import imgLargeClasses from "./ImageLarge.module.css";
import Image from "./Image";
import PropTypes from "prop-types";
import { galleryActions } from "../../store/images-slice";
import { useDispatch } from "react-redux";

function ImageLarge({
  id,
  url,
  description,
  name,
  isChecked,
  showSelectButton,
  onClick,
}) {
  const dispatch = useDispatch();

  return (
    <div>
      <Image
        {...{
          id,
          url,
          description,
          name,
          isChecked,
          showSelectButton,
          onClick,
          className: imgLargeClasses.img,
        }}
      />
      <button
        onClick={() => {
          dispatch(galleryActions.addToGallery(Image));
        }}
      >
        {" "}
        Submit{" "}
      </button>
    </div>
  );
}

ImageLarge.propTypes = {
  id: PropTypes.string.isRequired,
  description: PropTypes.string.isRequired,
  url: PropTypes.string.isRequired,
  name: PropTypes.string.isRequired,
  isChecked: PropTypes.bool,
  showSelectButton: PropTypes.bool,
  onClick: PropTypes.func,
};

export default ImageLarge;
